import React from 'react'

const ContactCard = ({ name, tel, email }) => {
  return (
    <div className='contact__card mx-10'>
        <img src='profilepic.png' className='lg:w-20 mx-auto p-2 w-32'/>
        <h2>Name: {name}</h2>
        <h3>Telephone: {tel}</h3>
        <h3>Email: {email}</h3>
    </div>
  )
}

export default ContactCard
